(*Graphics output massaging*)


sanitizeGraphicsForComparison[g_]:=ReplaceAll[
	HoldPattern[g],
	{
		HoldPattern[Set[_Symbol,_]]:>(_),
		RuleDelayed[TrackedSymbols,_]:>RuleDelayed[TrackedSymbols,{___}],
		RuleDelayed["MouseClicked",_]->RuleDelayed[ "MouseClicked",_],
		DynamicBox[{_FEPrivate`If,_}]->DynamicBox[{_,_}],
		HoldPattern[Dynamic[If[_Symbol,a_,b_,c_],TrackedSymbols:>{___}]]:>Dynamic[If[_,a,b,c],TrackedSymbols:>{___}],
		_Symbol?(And[MatchQ[Context[#],"DynamicChart`"],StringMatchQ[SymbolName[#],"click$"~~___]]&):>(_Symbol)
	}
];


